from collections import defaultdict
class Solution:
    def findAnagrams(self, s: str, p: str) -> list[int]:
        ns = len(s)
        np = len(p)
        hash_map = defaultdict(int)
        result = list()

        if np > ns:
            return []

        for char in p:
            hash_map[char] += 1

        for i in range(np-1):
            if s[i] in hash_map:
                hash_map[s[i]] -= 1
        
        for i in range(-1,ns-np+1):
            if i>-1 and s[i] in hash_map:
                hash_map[s[i]] += 1
            if i+np < ns and s[i+np] in hash_map:
                hash_map[s[i+np]] -= 1
            if all(x == 0 for x in hash_map.values()):
                result.append(i+1)
        
        return result


s = Solution()
result = s.findAnagrams(
        ""
        ,"")
print(result)